import React from 'react';
import { Document } from '../types/documents';
import { DocumentItemStyle } from './StyledComponents';

interface DocumentItemProps {
  document: Document;
}

const DocumentItem: React.FC<DocumentItemProps> = ({ document }) => {
  return (
    <DocumentItemStyle>
      {document.name}
      <span className="document-type">{document.type.toUpperCase()}</span>
      <span className="added-date">{document.added}</span>
    </DocumentItemStyle>
  );
};

export default DocumentItem;
